// src/components/challenges/ControlPanel.jsx
import React, { useState } from 'react';
import { 
  Paper, 
  Typography, 
  Box, 
  Slider, 
  Switch, 
  FormControlLabel,
  Button,
  Grid,
  TextField,
  Accordion,
  AccordionSummary,
  AccordionDetails
} from '@mui/material';
import { ExpandMore, PlayArrow, Stop, Refresh } from '@mui/icons-material';
import { useSelector, useDispatch } from 'react-redux';
import { updateRobotSettings } from '../../store/robotSlice';

const ControlPanel = ({ isRunning, challengeConfig }) => {
  const dispatch = useDispatch();
  const { settings, isConnected } = useSelector(state => state.robot);
  const [localSettings, setLocalSettings] = useState(settings);

  const handleSettingChange = (setting, value) => {
    const newSettings = { ...localSettings, [setting]: value };
    setLocalSettings(newSettings);
    dispatch(updateRobotSettings(newSettings));
  };

  const handleReset = () => {
    const defaultSettings = {
      speed: 50,
      precision: 75,
      safetyMode: true,
      sensorSensitivity: 50,
      pidKp: 1.0,
      pidKi: 0.1,
      pidKd: 0.05
    };
    setLocalSettings(defaultSettings);
    dispatch(updateRobotSettings(defaultSettings));
  };

  return (
    <Paper elevation={2} sx={{ p: 2 }}>
      <Typography variant="h6" gutterBottom>
        Control Panel
      </Typography>

      <Accordion defaultExpanded>
        <AccordionSummary expandIcon={<ExpandMore />}>
          <Typography variant="subtitle1">Basic Settings</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Grid container spacing={3}>
            <Grid item xs={12}>
              <Typography gutterBottom>Speed: {localSettings.speed}%</Typography>
              <Slider
                value={localSettings.speed}
                onChange={(_, value) => handleSettingChange('speed', value)}
                min={10}
                max={100}
                disabled={!isConnected || isRunning}
                marks={[
                  { value: 25, label: 'Slow' },
                  { value: 50, label: 'Medium' },
                  { value: 75, label: 'Fast' },
                  { value: 100, label: 'Max' }
                ]}
              />
            </Grid>

            <Grid item xs={12}>
              <Typography gutterBottom>Precision: {localSettings.precision}%</Typography>
              <Slider
                value={localSettings.precision}
                onChange={(_, value) => handleSettingChange('precision', value)}
                min={25}
                max={100}
                disabled={!isConnected || isRunning}
                marks={[
                  { value: 25, label: 'Low' },
                  { value: 50, label: 'Medium' },
                  { value: 75, label: 'High' },
                  { value: 100, label: 'Max' }
                ]}
              />
            </Grid>

            <Grid item xs={12}>
              <FormControlLabel
                control={
                  <Switch
                    checked={localSettings.safetyMode}
                    onChange={(e) => handleSettingChange('safetyMode', e.target.checked)}
                    disabled={!isConnected || isRunning}
                  />
                }
                label="Safety Mode"
              />
            </Grid>
          </Grid>
        </AccordionDetails>
      </Accordion>

      <Accordion>
        <AccordionSummary expandIcon={<ExpandMore />}>
          <Typography variant="subtitle1">Advanced Settings</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Grid container spacing={2}>
            <Grid item xs={12}>
              <Typography gutterBottom>
                Sensor Sensitivity: {localSettings.sensorSensitivity}%
              </Typography>
              <Slider
                value={localSettings.sensorSensitivity}
                onChange={(_, value) => handleSettingChange('sensorSensitivity', value)}
                min={10}
                max={100}
                disabled={!isConnected || isRunning}
              />
            </Grid>

            <Grid item xs={4}>
              <TextField
                label="PID Kp"
                type="number"
                size="small"
                value={localSettings.pidKp}
                onChange={(e) => handleSettingChange('pidKp', parseFloat(e.target.value))}
                inputProps={{ step: 0.1, min: 0, max: 10 }}
                disabled={!isConnected || isRunning}
              />
            </Grid>

            <Grid item xs={4}>
              <TextField
                label="PID Ki"
                type="number"
                size="small"
                value={localSettings.pidKi}
                onChange={(e) => handleSettingChange('pidKi', parseFloat(e.target.value))}
                inputProps={{ step: 0.01, min: 0, max: 1 }}
                disabled={!isConnected || isRunning}
              />
            </Grid>

            <Grid item xs={4}>
              <TextField
                label="PID Kd"
                type="number"
                size="small"
                value={localSettings.pidKd}
                onChange={(e) => handleSettingChange('pidKd', parseFloat(e.target.value))}
                inputProps={{ step: 0.01, min: 0, max: 1 }}
                disabled={!isConnected || isRunning}
              />
            </Grid>
          </Grid>
        </AccordionDetails>
      </Accordion>

      <Box mt={3}>
        <Button
          variant="outlined"
          startIcon={<Refresh />}
          onClick={handleReset}
          disabled={!isConnected || isRunning}
          fullWidth
        >
          Reset to Defaults
        </Button>
      </Box>

      <Box mt={2}>
        <Typography variant="caption" color="text.secondary">
          Connection: {isConnected ? 'Connected' : 'Disconnected'}
        </Typography>
      </Box>
    </Paper>
  );
};

export default ControlPanel;
